"use strict";function sendSubscriptionId(n){fetch("https://family1st-push.appspot.com/subscribe",{method:"post",body:JSON.stringify({subid:n.subscriptionId,href:window.location.href}),headers:{"Content-type":"application/json; charset=utf-8"}}).then(function(n){return n.json()}).then(function(n){console.log(n)})["catch"](function(n){console.log("Fetch Error :-S",n)})}function subscribeDevice(){navigator.serviceWorker.ready.then(function(n){n.pushManager.subscribe().then(function(n){sendSubscriptionId(n),console.log('curl --header "Authorization: key=API_KEY" --header Content-Type:"application/json" '+n.endpoint+' -d "{\\"registration_ids\\":[\\"'+n.subscriptionId+'\\"]}"')})})}function serviceWorkerRegistration(){navigator.serviceWorker.register("/sw.js").then(function(n){subscribeDevice()})}window.addEventListener("DOMContentLoaded",function(){"serviceWorker"in navigator&&navigator.serviceWorker.getRegistration().then(function(n){n?n.pushManager.getSubscription().then(function(n){n?console.log('curl --header "Authorization: key=API_KEY" --header Content-Type:"application/json" '+n.endpoint+' -d "{\\"registration_ids\\":[\\"'+n.subscriptionId+'\\"]}"'):serviceWorkerRegistration()}):serviceWorkerRegistration()})}),document.addEventListener("DOMContentLoaded",function(n){jQuery(function(){$(window).bind("scroll",function(){$(this).scrollTop()>150?$(".social-button").fadeIn():$(".social-button").fadeOut(),$(".social-button").css({position:"fixed",bottom:"100px"})})})});